/* eslint-disable import/no-mutable-exports */
import useProfileData from 'hoc/useProfileData';
import React, { Suspense, useDeferredValue, useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { Link, useSearchParams } from 'react-router-dom';
import styled from 'styled-components';
import CareerConnectionBanner from './CareerConnectionBanner';
import { fetchProfileDataLevel3, fetchUserProfile } from './fetchProfileData';
// import ProfileAside from './ProfileAside';
import ProfileLevel1 from './ProfileLevel1';
import ProfileLevel2 from './ProfileLevel2';
import ProfileLevel3 from './ProfileLevel3';
import ProrfileLevel4 from './ProrfileLevel4';

const baseUserData = fetchUserProfile();

function ProfilePage() {
	const [searchParams, setSearchParams] = useSearchParams();
	const level = searchParams.get('level');
	const { userId, jwt } = useSelector((state) => state.UserDataReducer);
	const [fetchTest, setFetchTest] = useState(baseUserData);

	return (
		<Suspense>
			<ComponentWrapper>
				<nav className="profile-title">
					<h2>
						<p>프로필</p>
					</h2>
				</nav>
				<div className="machup">
					<Suspense fallback={<h1>로딩 중..</h1>}>
						<ProfileAside />
					</Suspense>
					<section>
						<CareerConnectionBanner />
						<Suspense>
							{level === '4' && <ProrfileLevel4 />}
							{/* {level === '3' && (
							<ProfileLevel3
								level3Data={fetchProfileDataLevel3({
									userId,
									jwt,
								})}
							/>
						)} */}
							{level === '2' && <ProfileLevel2 />}
							{level === '1' && <ProfileLevel1 />}
						</Suspense>
					</section>
				</div>
			</ComponentWrapper>
		</Suspense>
	);
}
function ProfileAside({ test }) {
	return (
		<ProfileAsideWrapper>
			<header className="aside-header">
				<div className="aside-avatar">
					<div
						className="aside-avatar_image"
						style={{
							backgroundImage: `url("https://k.kakaocdn.net/dn/cHUADA/btrvJZxMkUJ/5zLQF5ttsOh1ffK7MPThw1/img_110x110.jpg"), url("https://static.wanted.co.kr/images/profile_default.png")`,
						}}
					>
						<div className="avatarcrop">
							<input type="file" accept="image/*" />
							<i className="icon-camera" role="presentation" />
						</div>
					</div>
				</div>
				<div className="aside-me">
					<div className="aside-me-name">이해찬</div>
					<div className="aside-me-email">bun0373@gmail.com</div>
					<div className="aside-me-tel">010-2697-2321</div>
				</div>
				<Link to="/profile/matching?level=1" className="aside-edit">
					기본정보 수정
				</Link>
			</header>
			<div className="matchupstatus ">
				<Link
					to="/profile/status?type=matchup-likes"
					className="matchupstatus-item"
				>
					<span className="matchupstatus-label">관심 있음</span>
					<strong className="matchupstatus-value">0</strong>
				</Link>
				<Link
					to="/profile/status?type=matchup-opens"
					className="matchupstatus-item"
				>
					<span className="matchupstatus-label">열람</span>
					<strong className="matchupstatus-value">0</strong>
				</Link>
				<Link
					to="/profile/status?type=matchup-offers"
					className="matchupstatus-item"
				>
					<span className="matchupstatus-label">받은 제안</span>
					<strong className="matchupstatus-value">0</strong>
				</Link>
			</div>
		</ProfileAsideWrapper>
	);
}

const ProfileAsideWrapper = styled.aside`
	top: 0;
	left: 0;
	width: 250px;
	position: absolute;
	padding: 42px 20px 41px;
	border: 1px solid #e1e2e3;
	border-radius: 3px;
	background-color: #fff;
	margin-bottom: 0;
	.aside-header {
		width: 100%;
		text-align: center;
	}
	.aside-avatar {
		line-height: 1.4;
	}
	.aside-avatar_image {
		display: inline-block;
		position: relative;
		width: 77px;
		height: 77px;
		border-radius: 50%;
		background-size: cover;
		background-position: 50%;
	}
	.avatarcrop {
		width: 100%;
		height: 100%;
		position: relative;
		text-align: center;
		cursor: pointer;
		box-shadow: none !important;
		input {
			opacity: 0;
			cursor: pointer;
			width: 100%;
			height: 100%;
		}
	}
	.icon-camera {
		position: absolute;
		right: -4px;
		bottom: 0;
		padding: 8px;
		font-size: 16px;
		color: #999;
		line-height: 1;
		border-radius: 50%;
		background-color: #fff;
		box-shadow: 0 2px 2px 0 rgb(0 0 0 / 10%);
	}
	.aside-me {
		margin-top: 31px;
		font-size: 14px;
		font-weight: 500;
		line-height: 1.07;
		color: #999;
	}
	.aside-me-name {
		line-height: 1.3;
		width: 100%;
		text-overflow: ellipsis;
		white-space: nowrap;
		overflow: hidden;
		font-size: 18px;
		font-weight: 600;
		color: #333;
	}
	.aside-me-email {
		line-height: 1.3;
		width: 100%;
		text-overflow: ellipsis;
		white-space: nowrap;
		overflow: hidden;
	}
	.aside-me-tel {
		margin-top: 10px;
	}
	.aside-edit {
		display: flex;
		justify-content: center;
		align-items: center;
		width: 160px;
		height: 40px;
		border-radius: 20px;
		border: 1px solid #e1e2e3;
		margin: 30px auto 0;
		font-size: 16px;
		line-height: 0.94;
		color: #333;
	}
	.matchupstatus {
		margin-top: 42px;
	}
	.matchupstatus-item:first-child {
		margin-top: 0;
	}
	.matchupstatus-item {
		display: flex;
		justify-content: space-between;
		align-items: center;
		margin-top: 23px;
		font-size: 16px;
		font-weight: 400;
		line-height: 1.06;
	}
	.matchupstatus-label {
		word-break: break-word;
		line-height: 22px;
	}
	.matchupstatus-value {
		font-size: 18px;
		font-weight: 600;
	}
`;

const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;

	.machup {
		margin: 0 auto;
		max-width: 1060px;
		position: relative;
		> section {
			padding-left: 270px;
		}
	}
	.profile-title {
		position: relative;
		line-height: normal;
		p {
			font-size: 20px;
			font-weight: 700;
			color: #333;
			padding: 50px 0 20px;
		}
	}
`;

export default ProfilePage;
